import React, { useState } from 'react';
import '../styles/common.css';

function OrganiserDetailForm() {
  const [formData, setFormData] = useState({
    fullName: '',
    organisation: '',
    roleTitle: '',
    website: '',
    contactNumber: '',
    location: '',
    preferredEventTypes: [],
    description: ''
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;

    if (type === 'checkbox') {
      setFormData((prev) => {
        const updatedTypes = checked
          ? [...prev.preferredEventTypes, value]
          : prev.preferredEventTypes.filter((type) => type !== value);
        return { ...prev, preferredEventTypes: updatedTypes };
      });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Organiser submitted:', formData);
    alert('Thank you for registering as an organiser!');
  };

  return (
    <div className="form-container">
      <div className="register-card">
        <h2 className="register-title">Organiser Details</h2>
        <form className="register-form" onSubmit={handleSubmit}>
          <div className="form-field">
            <label>Full Name</label>
            <input type="text" name="fullName" value={formData.fullName} onChange={handleChange} required />
          </div>

          <div className="form-field">
            <label>Organisation Name</label>
            <input type="text" name="organisation" value={formData.organisation} onChange={handleChange} required />
          </div>

          <div className="form-field">
            <label>Role Title</label>
            <input type="text" name="roleTitle" value={formData.roleTitle} onChange={handleChange} required />
          </div>

          <div className="form-field">
            <label>Organisation Website</label>
            <input type="url" name="website" value={formData.website} onChange={handleChange} />
          </div>

          <div className="form-field">
            <label>Contact Number</label>
            <input type="text" name="contactNumber" value={formData.contactNumber} onChange={handleChange} />
          </div>

          <div className="form-field">
            <label>Location</label>
            <input type="text" name="location" value={formData.location} onChange={handleChange} />
          </div>

          <div className="form-field">
            <label>Preferred Event Types</label>
            <label><input type="checkbox" name="preferredEventTypes" value="Conference" onChange={handleChange} /> Conference</label>
            <label><input type="checkbox" name="preferredEventTypes" value="Concert" onChange={handleChange} /> Concert</label>
            <label><input type="checkbox" name="preferredEventTypes" value="Workshop" onChange={handleChange} /> Workshop</label>
            <label><input type="checkbox" name="preferredEventTypes" value="Meetup" onChange={handleChange} /> Meetup</label>
          </div>

          <div className="form-field">
            <label>Organisation Description</label>
            <textarea name="description" rows="4" value={formData.description} onChange={handleChange}></textarea>
          </div>

          <button type="submit" className="signup-btn">Submit</button>
        </form>
      </div>
    </div>
  );
}

export default OrganiserDetailForm;
